import { Component } from "./Component";
import { useGlobalContext } from "./context";
const AllComponents = () => {
  const { cleaner } = useGlobalContext();
  return (
    <section>
      <table>
        <tr>
          <th>to do</th>
          <th>doing</th>
          <th>done</th>
        </tr>
        <tr>
          <Component name="todo" />
          <Component name="doing" />
          <Component name="done" />
        </tr>
      </table>
      <button onClick={clean}>clean</button>
    </section>
  );
};

export default AllComponents;
